        </Wrapper>
      ) : (
        <></>
      )}
      <div className="container mt-2 p-5">
        <Link to="/create-shipping">
          <button className="btn btn-success">Create New Shipping</button>
        </Link>
        <TableShipping />
      </div>
      <Footer />
    </>
  );
}

export default Shipping;
